import React from "react";
import styled from '@emotion/styled';


class BottomNav extends React.Component {
  render() {

    return (
      <>
        <Footer>
          <Footerinner>
            {this.props.children}
          </Footerinner>
        </Footer>
      </>
    );
  }
}

export default BottomNav;
